(function() {
    'use strict';
    let globalhover = null;
    let chatmesslist,messin,messout = null;
    function checkmess(){
        setInterval(()=>{
            //console.log(globalhover);
            chatmesslist = document.getElementsByClassName("_ak8j");
            messin = document.getElementsByClassName("message-in");
            messout = document.getElementsByClassName("message-out");
            chatmesslist = [...chatmesslist,...messin, ...messout];
            if(chatmesslist.length==0){
                console.log("chat not found");
            }else{
                blurchat(chatmesslist);
            }
        },50);
    }
    function blurchat(cml){
        for(let i=0;i<cml.length;i++){
            let chatmess = cml[i];
            if(chatmess != globalhover){
                if(chatmess.classList.contains("message-in") || chatmess.classList.contains("message-out")){
                    chatmess.style.filter = "blur(7px)";
                }else{
                    chatmess.children[0].style.filter = "blur(3px)";
                }
                if(chatmess.onmouseover==null){
                    //if(chatmess.classList.contains("message-in") || chatmess.classList.contains("message-out")){
                    //    chatmess.children[1].onmouseover=revealchat;
                    //}else{
                    //    chatmess.onmouseover=revealchat;
                    //}
                    chatmess.onmouseover=revealchat;
                    chatmess.onmouseout=clearstatehover;
                }
            }
        }
    }

    function clearstatehover(){
        if(globalhover!=null){
            globalhover=null}
    };

    function revealchat(ev){
        let noder = ev.target;
        if(noder.classList.contains("message-in") || noder.classList.contains("message-out") || noder.classList.contains("_ak8j")){
        }else{
            do{
                noder = noder.parentElement;
            }while(!(noder.classList.contains("_ak8j") || noder.classList.contains("message-in") || noder.classList.contains("message-out")));
        }
        if(noder.classList.contains("message-in") || noder.classList.contains("message-out")){
            noder.style.filter = null;
        }else{
            noder.children[0].style.filter = null;
        }
        globalhover = noder;
    }
    checkmess();
    // Your code here...
})();
